import { Box, TextField } from '@mui/material';
import React from 'react'

const userLogin = () => {
  return <>
  <Box component='form' noVariable sx={{ mt:1}} id='login-form'>
    <TextField required fullWidth id='email' name='email' label='Email Address'/>
    <TextField required fullWidth id='password' name='password' type='password' label='User Password'/>
  </Box>
  </>;
}

export default userLogin
